As per the screenshot of the issue 

![image](https://user-images.githubusercontent.com/29415595/195059064-55469c33-af17-4f6f-855e-3c37323effe6.png)

It seems that the issue is when trying to query the storage

const identityOpt = useCall<Option<Registration>>(api.query.identity.identityOf, [address]);

which returns something which is not one of these

```
useEffect((): void => {
    if (identityOpt?.isSome) {
      const { info } = identityOpt.unwrap();

      setData(info.display, null, setValDisplay);
      setData(info.email, setHasEmail, setValEmail);
      setData(info.legal, setHasLegal, setValLegal);
      setData(info.riot, setHasRiot, setValRiot);
      setData(info.twitter, setHasTwitter, setValTwitter);
      setData(info.web, setHasWeb, setValWeb);
    }
  }, [identityOpt]);

```

Have added a check before checking data.isRaw. 
Also asked user for the address to check the identity storage at that address

